import React, { useState } from "react"
import PropTypes from 'prop-types';
import { withTranslation } from "react-i18next"
import { Link } from "react-router-dom"

import {
  Table,
  Card,
  CardBody,
  Row,
  Col,
  Button
} from "reactstrap"

const CheckList = (props) => {

    
    
      const dataRows = results.map((data) => (
        <tr key={ data.id }>
                  
          <td>{ data.comentario }</td>
          <td> 
            <Button  color="link" className="btn btn-link" ><i className="mdi mdi-eye mdi-16px"></i></Button>
          </td>
    
        </tr>)
      );

  return (

    <React.Fragment>
        
    <Row>
  <Col lg="12">
  <p className="card-title-desc"></p>
    <h4 className="card-title"> </h4>
    <p className="card-title-desc"></p>
    
    <div className="table-responsive">
          <Table className="table mb-0">
            <thead className="table-light">
              <tr>
            
              <th colSpan={2}> <h4 className="card-title">{ props.t("LegalDocumentation") }</h4>
   </th>
         
              </tr>
            </thead>
            <tbody>
              { dataRows }
            </tbody>
          </Table>
           
        </div>  

  </Col>
</Row>

    </React.Fragment>



  );
};

CheckList.propTypes = {
  items: PropTypes.array.isRequired,
  addCheckListItem: PropTypes.func
};

export default (withTranslation()(CheckList));
